import React from 'react';
import ImageGallery from 'react-image-gallery';
import Grid from "@material-ui/core/Grid";

const images = [
  {
    original: 'https://picsum.photos/id/1018/1000/600/',
    thumbnail: 'https://picsum.photos/id/1018/250/150/',
  },
  {
    original: 'https://picsum.photos/id/1015/1000/600/',
    thumbnail: 'https://picsum.photos/id/1015/250/150/',
  },
  {
    original: 'https://picsum.photos/id/1019/1000/600/',
    thumbnail: 'https://picsum.photos/id/1019/250/150/',
  },
];

const preUrl = 'https://www.nps.gov/common/uploads/structured_data/';
const images2 = [
  {
    original: `https://www.nps.gov/common/uploads/structured_data/${res2[0]}`,
    thumbnail: `https://www.nps.gov/common/uploads/structured_data/${res2[0]}`,
  },
  {
   original: `https://www.nps.gov/common/uploads/structured_data/${res2[1]}`,
    thumbnail: `https://www.nps.gov/common/uploads/structured_data/${res2[1]}`,
  },
];

//Smart Component
class ImgGallery extends React.Component {
  render() {
    return <ImageGallery items={images2} />;
  }
}

export default ImgGallery

